import { useEffect } from "react";

const Home = () => {

  useEffect
  const api = () => {
    fetch(
      "https://api.themoviedb.org/3/movie/popular?api_key=0557b758465b10519557edb25fc53d86&language=en-US&page=1"
    )
      .then((res) => {
        console.log(res);
        return res.json();
      })
      .then((data) => {
        console.log(data);
        return data;
      });
  };

  return (
    <div className="homepage">
      <form>
        <input type="text" name="search" placeholder="search for movie..." />
        <button className="btn btn-primary">Search</button>
      </form>
      <button className="btn btn-secondary" onClick={() => api()}>Click Me</button>
    </div>
  );
};

export default Home;
